import React,{Component} from'react'


class Services extends Component {
constructor(props) {
    super();

    this.state={
        count:'0',
        email:'sivaawesome234@gmail.com'
        
    }
}
render() {
    return(<>
        {this.state.email}
        </>)
}


}

export default Services
